window.bookSummaryJSON = "<p><b>\"Non-stop action! Space battles! Intrigue! This is the kind of space opera that I love best - but Elliott does it even better.\" (</b><b><i>New York Times</i></b><b> best-selling author Ann Leckie)</b></p> <p><b><i>New York Times</i></b><b> best-selling author Kate Elliott brings us a thrilling new science fiction adventure set in a rich universe full of political intrigue with </b><b><i>Unconquerable Sun</i></b><b>. </b></p> <p><b>Gender-Spun Alexander the Great on an Interstellar Scale</b>&nbsp;</p> <p>Princess Sun has finally come of age.&nbsp;</p> <p>Growing up in the shadow of her mother, Eirene, has been no easy task. The legendary queen-marshal did what everyone thought impossible: expel the invaders and build Chaonia into a magnificent republic, one to be respected - and feared.&nbsp;</p> <p>But the cutthroat ambassador corps and conniving noble houses have never ceased to scheme - and they have plans that need Sun to be removed as heir, or better yet, dead.&nbsp;</p> <p>To survive, the princess must rely on her wits and companions: her biggest rival, her secret lover, and a dangerous prisoner of war.&nbsp;</p> <p>Take the brilliance and cunning courage of Princess Leia - add in a dazzling futuristic setting where pop culture and propaganda are one and the same - and hold on tight: This is the space opera youâ€™ve been waiting for.&nbsp;</p> <p><b><i>Milwaukee Journal Sentinel </i></b><b>Guide to the 100 Best Books of the Year - 2020 </b></p> <p>A Macmillan Audio production from Tor Books&nbsp;</p>"; 
